import logo from './katepic.jpeg';
import bg from './bg.jpg';
import './App.css';

import './App.css';

function App() {
  return (
    <div className="App" styles={{ backgroundImage:`url(${bg})` }}>

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
        Merry Christmas Katie!!
        </p>
      </header>
    </div>
  );
}

export default App;
